import { INCREMENT, DECREMENT, RESET } from "../types";

export function doincrement() {
  return { type: INCREMENT };
}

export function dodecrement() {
  return { type: DECREMENT };
}

export function doreset() {
  return { type: RESET };
}

export function Plusfive() {
  return { type: RESET };
}
